DROP TABLE IF EXISTS `venta`;
CREATE TABLE `venta` (
  `idVenta` int(11) NOT NULL AUTO_INCREMENT,
  `correoCliente` varchar(40) DEFAULT NULL COMMENT 'Correo electrónico del cliente',
  `idProducto` varchar(255) DEFAULT NULL,
  `unitarioVenta` double(10,2) DEFAULT NULL,
  `subtotalVenta` double(10,2) DEFAULT NULL,
  `impuestosVenta` double(10,2) DEFAULT NULL,
  `totalVenta` double(10,2) DEFAULT NULL,
  `formaVenta` varchar(50) DEFAULT NULL,
  `cantidadProducto` int(10) DEFAULT NULL,
  `horaVenta` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `estadoVenta` tinyint(255) DEFAULT '0',
  PRIMARY KEY (`idVenta`),
  KEY `fkProductoCompra` (`idProducto`),
  KEY `fkCliente` (`correoCliente`),
  CONSTRAINT `fkCliente` FOREIGN KEY (`correoCliente`) REFERENCES `cliente` (`correoCliente`),
  CONSTRAINT `fkProductoCompra` FOREIGN KEY (`idProducto`) REFERENCES `modelo` (`idModelo`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=latin1;

